Bitter Sweet (DvdRip / 2013)

A young aspiring line producer (Zoey Monroe) gets stuck with the task of getting a hard partying male fashion model (Xander Corvus) to his shoots on time. Filmed in the hip downtown loft area of LA, Bitter Sweet takes you deep into the wild world of fashion photography as male models hook up with sexy makeup artists (Emily Austin), cocktail waitresses (Riley Reid), aspiring dancers (Melody Jordan) and photographers score with high end models (Alyssa Branch). Zoey soon finds herself falling for Xander and must decide does she stay and try to work it out or move on to her dream position in New York!

